import React from 'react';
import Link from 'next/link';

const Pesquisa = () => {
  return (
    <div >
      <h1 className='mt-6 text-center font-bold'>Críticas e Sugestões</h1>
      <p className='mt-6 text-center'>O restaurante X sempre buscar atender melhor seus clientes.<br/>Por isso, estamos sempre abertos a ouvir sua opinião</p>
      <div className='text-center my-12'>
        <Link href="/pesquisa">
          <a className='bg-blue-400 px-12 py-4 font-bold rounded-lg shadow-lg hover:shadow'>Enviar</a>
        </Link>
      </div>
    </div>
  )
};

export default Pesquisa;
